  input: TEXT,F3XA,,"This amendment responds to the Commission's letter of 2/8/2006.
    Please note that the letter was sent to an address no longer used by the committee,
    therefore the commiittee did not learn of this letter until 3/08/2006. The committee
    has filed an amend FEC Form 1 to update the committees address. Here are the following
    responses for your letter dated 2/8/2006 1. The committee excersises best efforts
    with respect to fundraising, the committee requests occupation and employer information
    when it solicits contributions and follows up with best efforts. This  amendment
    discloses additional information for donors not included in the previous report
    filing. Of the 18 donors with missing information the committee has provided 15
    of these. 2.  Our committee was unaware of the changes that required the committee
    to allocate administration expense at 50%. Due to this misunderstanding the committee
    over-transfered the federal portion of allocation exenses by $12,104.38 . On 3/15/2006
    the committee wrote a check to repay the non-federal accout for its share of the
    over transfer. Please note the committee's allocation is correct for the 2005
    year-end reporting period. 3. The committee has amended this report to correct
    the form H4 to refect the correct allocation percentages for the fundraising expenses
    and has moved 100% federal activity to Line 21b."
